import{getCookie}from"../cookies.min.js";const fetchEditCard=e=>{console.log(e.id),fetch("https://ajax.test-danit.com/api/v2/cards/"+e.id,{method:"PUT",headers:{"Content-Type":"application/json",Authorization:"Bearer "+getCookie("token")},body:JSON.stringify({doctor:e.doctor,name:e.name,specialist:e.specialist,specialistEng:e.specialistEng,visit:e.visit,about:e.about,urgency:e.urgency,pressure:e.pressure,massIndex:e.massIndex,diseases:e.diseases,age:e.age,lastDate:e.lastDate,id:e.id,clientAge:e.age})})};export{fetchEditCard};